    subject: Homepage
    content:
      title: <h1>Welcome to BMDS online.</h1>
      template: "<div class=\"row\">\n    <div class=\"col-sm-12\">\n        <h1>Welcome
        to BMDS online.</h1>\n    </div>\n</div>\n<div class=\"row\">\n    <div class=\"col-md-8\">\n
        \       <div class=\"col-lg\">\n            <p>\n                This web-application
        executes the US EPA's benchmark dose modeling software (<a href=\"https://www.epa.gov/bmds\">BMDS</a>).\n
        \           </p>\n            <ul>\n                <li>Load example datasets
        below to view example input files; for more information, see the <a  href=\"http://bmds-server.readthedocs.io/en/latest/\">documentation</a>\n
        \               </li>\n                <li>Software is designed for automated
        BMDS execution using a\n                    programming language such as Python,
        R, or Java. To take\n                    advantage of automation, use the
        <a href=\"/api/v1/\">API</a>,\n                    and see the <a href=\"http://bmds-server.readthedocs.io/en/latest/quickstart.html\">quickstart</a>
        section.\n                </li>\n            </ul>\n        </div>\n    </div>\n
        \   <div class=\"col-md-4\">\n        <form method=\"post\">\n            {%
        csrf_token %}\n            <label for=\"id_id\">Create a new analysis:</label>\n
        \           <button type=\"submit\" class=\"btn btn-primary btn-block mb-1\">Create
        a new BMDS analysis</button>\n            <p class=\"text-muted\">Analyses
        are deleted after {{days_to_keep_analyses}} days.</p>\n        </form>\n    </div>\n</div>\n"
